      mcpTimeChangeLogList: null,
      mcEndDateNew: null,
      mcEndDate: null,
      mcRechargeRemark: null,
      minDate: new Date(1940, 0, 1),
      maxDate: new Date(),
      currentDate: new Date(),
      rechargeDate: null,
